import React from "react";
import { CssBaseline, Typography,Container,Button,SendIcon } from '@material-ui/core';

const App = () => {
    return (
       <>
        <main>
            <div>
                <Container maxWidth ='sm'>
                    <Typography variant="h1" align='center' color='textPrimary' gutterBottom>
                        사주로 보는 당신의 형상은?
                    </Typography>
                    <Button variant="contained" endIcon={<SendIcon />}>
                        보러가기
                    </Button>
                </Container>
            </div>
        </main>
        </>
    );
}

export default App;
